syntax "proto3";

package aws;

message AwsDefaultVpc {
  arn = 1;
  assign_generated_ipv6_cidr_block = 2;
  cidr_block = 3;
  default_network_acl_id = 4;
  default_route_table_id = 5;
  default_security_group_id = 6;
  dhcp_options_id = 7;
  enable_classiclink = 8;
  enable_classiclink_dns_support = 9;
  enable_dns_hostnames = 10;
  enable_dns_support = 11;
  id = 12;
  instance_tenancy = 13;
  ipv6_association_id = 14;
  ipv6_cidr_block = 15;
  main_route_table_id = 16;
  owner_id = 17;
  tags = 18;
}